	/**
	 * Initalize flash to set LSO and retrieve system fonts.
	 
	 LSO’s are like cookies and are sometimes referred to flash cookies 
	 but there are 2 main differences between them. 
	 A normal HTTP cookie can store around 4k of data, 
	 while the flash cookie can store up to 100k. 
	 Also a normal cookie is pretty easy to remove 
	 while removing a flash cookie is far more convoluted, 
	 which is a matter of some contention.

	**/
